Quarta votazione per il #presidentedellarepubblica 
Oggi cambia il quorum, sono sufficienti 505 voti, ma questo spinge ancora di più a cercare un accordo perché nessuno deve pensare di poter eleggere una figura divisiva che spacchi il Paese. Con #disciplina e #onore 
@Mov5Stelle https://t.co/0uvlpN5c8S

#SkyTg24 #Quirinale 
@FratellidItalia ha messo in campo strategia coerente su elezione #PdR: 1) prima la terna di nomi 2) candidatura di bandiera di #Crosetto ottenendo consenso largo 3) stasera chiediamo che domani il #cdx esprima compatto il voto su un nome solo
- Staff https://t.co/0Uwek4YoBD

#Tg2Italia #Quirinale
@FratellidItalia farà un voto di astensione alla seconda chiama. Abbiamo fatto passi avanti con la rosa e la candidatura di #Crosetto che ha preso doppio dei nostri voti. Avremmo voluto che oggi #cdx andasse compatto su un nome. Ci stiamo lavorando
